      SELECT - COUNT ( * ) / - MIN ( 37 ) * + COUNT ( * ) * - + 76 + COUNT ( * ) FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q737.out
    data: |
      9
